import logo from './logo.svg';
import './App.css';

import{
  Switch,
  Route,
  Redirect
} from "react-router-dom";

import WelcomePage from './composants/WelcomePage';
import LoginPage from './composants/LoginPage';

function App() {
  return (
    <>
      <Switch>
        <Route path="/Accueil">
          <WelcomePage/>
        </Route>
        <Route path="/Connexion">
          <LoginPage/>
        </Route>
        <Redirect from="/" to="/Accueil"/>
      </Switch>
    </>
  );
}

export default App;
